        eu.stamp_project.reneri.instrumentation.StateObserver.observe("yahoofinance.FxQuoteRequestTest|fxFlowTest()|14", (requestCount += 1));
        org.junit.Assert.assertEquals(eu.stamp_project.reneri.instrumentation.StateObserver.observe("yahoofinance.FxQuoteRequestTest|fxFlowTest()|15", requestCount), eu.stamp_project.reneri.instrumentation.StateObserver.observe("yahoofinance.FxQuoteRequestTest|fxFlowTest()|17", eu.stamp_project.reneri.instrumentation.StateObserver.<okhttp3.mockwebserver.MockWebServer>observeState("yahoofinance.FxQuoteRequestTest|fxFlowTest()|16", okhttp3.mockwebserver.MockWebServer.class, yahoofinance.mock.MockedServersTest.quotesServer).getRequestCount()));
